import React from "react";

const Navbar = () => {
  return (
    <div className="main-nav">
      <ul>
        <li>HOME</li>
        <li>ARTICLES</li>
        <li>ABOUT</li>
        <li>CONTACT</li>
      </ul>
    </div>
  );
};

export default Navbar;
